import React,{useState} from 'react';
import { 
    View,
    Text,
    StyleSheet,
    FlatList,
    TouchableOpacity
 } from 'react-native';
import {bankStudyTropics} from '../localdata/data';
import {COLORS} from '../constants';
import { NavigationContainer } from '@react-navigation/native';
const BankTropicScreen = ()=>{
    const [isLoading,setIsloading] = useState(true);

    const renderItem = ({item})=>{
        return(
            <View>
                <TouchableOpacity onPress={()=>NavigationContainer.push('Bankmoretropics',{
                    id:item.id,
                    title:item.name
                })}>
                    <Text>{item.name}</Text>
                </TouchableOpacity>
            </View>
        )
    }

    return(
        <View style={styles.container}>
            <FlatList 
            data={bankStudyTropics}
            keyExtractor={item=>item.id.toString()}
            renderItem={renderItem}
            />

        </View>
    )
}
const styles = StyleSheet.create({
    container:{
        flex:1,
        backgroundColor:COLORS.lightGray,
        paddingVertical:5
    }
})
export default BankTropicScreen;
